desc:
Gains 100 ATK for each face-down card in your Extra Deck. You can only use each of the following effects of "Dreaming Reality of Nemleria, Realized" once per turn. If this card is in your hand: You can target 1 monster you control; place it on the bottom of the Deck, and if you do, Special Summon this card. If this card is Special Summoned: You can activate 1 of these effects;
● Add 1 "Dreaming Nemleria" from your Deck to your face-up Extra Deck.
● Change 1 other face-up monster on the field to face-down Defense Position.

Cannot attack the turn it is Summoned. While you control "Toon World" and your opponent controls no Toon monsters, this card can attack your opponent directly. Once per turn: You can discard 1 "Toon" card, then activate 1 of these effects;
● Special Summon 1 Toon monster from your Deck, except "Toon Dark Magician", ignoring its Summoning conditions.
● Add 1 "Toon" Spell/Trap from your Deck to your hand.

To activate this card, you must draw it for your normal draw in your Draw Phase, reveal it, and keep it revealed until the Main Phase 1. During your Main Phase 1 that same turn: You can target 1 "Utopia" Xyz Monster you control, then activate 1 of these effects;
● Equip any number of "ZW -" monsters with different names from your Deck/Extra Deck to it.
● Special Summon from your Extra Deck, 1 "Utopia" Xyz Monster with a different name from that target, by using that target as material. (This is treated as an Xyz Summon. Transfer its materials to the Summoned monster.)

To activate this card, you must draw it for your normal draw in your Draw Phase, reveal it, and keep it revealed until the Main Phase 1. During your Main Phase 1 that same turn: You can target 1 "Utopia" Xyz Monster you control, then activate 1 of these effects;
● Equip any number of "ZW -" monsters with different names from your Deck/Extra Deck to it.
● Special Summon from your Extra Deck, 1 "Utopia" Xyz Monster with a different name from that target, by using that target as material. (This is treated as an Xyz Summon. Transfer its materials to the Summoned monster.)

Send this card to the GY during your 2nd Standby Phase after activation. You can only use the following effect of "Photon Change" once per turn. Send 1 "Photon" or "Galaxy" monster you control to the GY to activate 1 of these effects, or, if you send "Galaxy-Eyes Photon Dragon", you can activate both, in sequence;
● Special Summon 1 "Photon" monster from your Deck with a different original name than the sent monster.
● Add 1 "Photon" card from your Deck to your hand, except "Photon Change".

Send this card to the GY during your 2nd Standby Phase after activation. You can only use the following effect of "Photon Change" once per turn. Send 1 "Photon" or "Galaxy" monster you control to the GY to activate 1 of these effects, or, if you send "Galaxy-Eyes Photon Dragon", you can activate both, in sequence;
● Special Summon 1 "Photon" monster from your Deck with a different original name than the sent monster.
● Add 1 "Photon" card from your Deck to your hand, except "Photon Change".
